void draw_player(int x, int y, int x_size, int y_size, int offset);
void clear_player(int x, int y, int x_size, int y_size, int offset);
struct node* spawn_obstacle(struct node* head);
struct node* draw_obstacle(struct node* head); 
struct Obstacle create_obstacle();
bool collision(struct Player player, struct node* head);
void printTextOnScreen(int x, int y, char *scorePtr);
void draw_obstacle_helper(struct node* curr, int offset);
void clear_obstacle_helper(struct node* curr, int offset);
short int return_color(int x, int y);

int main(void){
    //Initialize the score to 0
    int totalScore = 0;
    int scoreOnes = 0;
    int scoreTens = 0;
    int scoreHundreds = 0;
    *LEDR_ptr = 0;
    int timeCount = 0;

    //Initialize FPGA 
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020; //Vga buffer
    volatile int* PS2_ptr = (int *) 0xFF200100; // ps2 keyboard

    *(pixel_ctrl_ptr + 1) = 0xC8000000;                                      
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); 
    
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen();

    //Player attributes
    const int PLAYER_X_SIZE = 75;
    const int PLAYER_Y_SIZE = 45;
    const int PLAYER_START_X = 75;
    const int PLAYER_START_Y = 185;

    //initialize player
    struct Player player;
    player.x = PLAYER_START_X;
    player.y = PLAYER_START_Y;
    player.y_dir = 0;
    player.x_dir = 0;
    player.x_size = PLAYER_X_SIZE;
    player.y_size = PLAYER_Y_SIZE;


    //Initialize obstacles 
    //Make linked list of obstacles
    //new obstacles always are at the end of the screen (end of list)
    //when obstacles get off screen: -> delete head of list
    struct node *head = NULL;

    //Initialize Ps2 Keyboard data
    int PS2_data;
    unsigned char data_in = 0;

    bool gameOver = false;

    //Main game loop
    while(!gameOver){
        timeCount++;

        // Plot score
        if (timeCount == 15) {
            timeCount = 0;
            totalScore++;
            scoreHundreds = totalScore / 100;
            scoreTens = (totalScore - scoreHundreds * 100) / 10;
            scoreOnes = totalScore - scoreHundreds * 100 - scoreTens * 10;
            *LEDR_ptr = totalScore;
        }

        char myScoreString[15];
        myScoreString[0] = 'M';
        myScoreString[1] = 'Y';
        myScoreString[2] = ' ';
        myScoreString[3] = 'S';
        myScoreString[4] = 'C';
        myScoreString[5] = 'O';
        myScoreString[6] = 'R';
        myScoreString[7] = 'E';
        myScoreString[8] = ':';
        myScoreString[9] = ' ';

        if (scoreHundreds != 0) {
            myScoreString[10] = scoreHundreds + '0';
        } 
        
        else {
            myScoreString[10] = ' ';
        }
        
        if (scoreHundreds == 0 && scoreTens == 0) {
            myScoreString[11] = ' ';
        } 
        
        else {
            myScoreString[11] = scoreTens + '0';
        }
        
        myScoreString[12] = scoreOnes + '0';
        myScoreString[13] = '\0';
        
        printTextOnScreen(285, 0, myScoreString);

        PS2_data = *PS2_ptr;
        data_in = PS2_data & 0xFF;

        //Gets direction code
        if(data_in == 0x1B && player.y + player.y_size < VGA_Y_MAX)
        {
            player.x_dir = 0;
            player.y_dir = 3;
        }
        else if(data_in == 0x1D && player.y > VGA_Y_MIN)
        {
            player.x_dir = 0;
            player.y_dir = -3;
        }
        else if(data_in == 0x1C && player.x > VGA_X_MIN)
        {
            player.y_dir = 0;
            player.x_dir = -3;
        }
        else if(data_in == 0x23 && player.x + player.x_size < VGA_Y_MAX)
        {
            player.y_dir = 0;
            player.x_dir = 3;
        }
        else
        {
            player.y_dir = 0;
            player.x_dir = 0;
        }
        
        
        // Erases player
        clear_player(player.x, player.y, player.x_size, player.y_size, 3);

        //updates new player direction
        player.y += player.y_dir;
        player.x += player.x_dir;
        // Draw player
        draw_player(player.x, player.y, player.x_size, player.y_size, 0);
        
        head = spawn_obstacle(head);
        head = draw_obstacle(head);
        gameOver = collision(player, head);

        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
    }

}

//forwards player collision detection using position comparison
bool collision(struct Player player, struct node* head)
{
    const int X_OFFSET = 5;
    const int Y_OFFSET = 25;
    if(head == NULL)
    {
        //No obstacle nothing to collide
        return false;
    }

    struct node* curr = head;
    while(curr->next != NULL)
    {
        struct Obstacle obs = curr->data;
        if(obs.x <= 0) 
        {
            curr = curr->next;
            continue;
        }
        if(player.x + player.x_size >= obs.x && player.y >= obs.y && player.y <= obs.y + obs.height - Y_OFFSET)
        {
            printf("Hit something 1 \n");
            return true;
        }
        else if(player.x + player.x_size >= obs.x && obs.y >= player.y && obs.y <= player.y + player.y_size - Y_OFFSET)
        {
            printf("Hit something 2 \n");
            return true;
        }
        else if(player.y <= obs.y + obs.height && player.x + player.x_size >= obs.x && player.x + player.x_size <= obs.x + obs.width)
        {
            printf("Hit something 3 \n");
            //return true;
        }
        curr = curr->next;
    }

    return false;
    
}


/* ///////////////////////////////////////////////////// Obstacle spawning ////////////////////////////////////////////// */
struct Obstacle create_obstacle()
{
    struct Obstacle data;
    data.x = VGA_X_MAX;
    data.y = rand () % VGA_Y_MAX;
    data.x_speed = -5;
    data.height = 45;
    data.width = 75;

    return data;
}
//randomly spawns obstacles and inserts into a linked list
struct node* spawn_obstacle(struct node* head){
    //Liklihood to spawn obstacle
    int num = rand() % 40;

    if(num == 3)
    {
        if(head == NULL)
        {
            struct node* newNode = (struct node*)malloc(sizeof(struct node));
            struct Obstacle data = create_obstacle();
            newNode->data = data;
            newNode->next = NULL;

            //Assigns to head
            head = newNode;
        }
        else
        {
            printf("Spawning obstacle \n");
            struct node* curr = head;
            while(curr->next != NULL)
            {
                curr = curr->next;
            }
            struct node* newNode = (struct node*)malloc(sizeof(struct node));

            struct Obstacle data = create_obstacle();
            newNode->data = data;
            newNode->next = NULL;

            curr->next = newNode;
        }
    }

    return head;
}

//Draws obstacles and deletes from linked list if off screen
struct node* draw_obstacle(struct node* head) {
    
    //Empty list
    if(head == NULL)
    {
        return NULL;
    }
    
    struct node* curr = head;
    
    //Draws obstacles
    while(curr->next != NULL){
        //off screen, delete from list
        if(curr->data.x + curr->data.width <= 0){
            struct node* temp = curr;
            curr = curr->next;
            free(temp);
            head = curr;
        }
        else{   
            //clears old obstacles
            clear_obstacle_helper(curr, curr->data.x_speed + 1);//curr->data.x_speed);
            curr->data.x +=  curr->data.x_speed;
            //Draws new obstacle positions 
            draw_obstacle_helper(curr, 0);
            curr = curr->next;
        }
    }
    return head;
}

/*//////////////////////////////////////////////////////////////    VGA DRAWING   /////////////////////////////////////////////////////////*/

//Iterates through the obstacle sizes and draws them, uses an offset to full clear old drawings
void draw_obstacle_helper(struct node* curr, int offset)
{
    int i = curr->data.x - offset;
    int j = curr->data.y - offset;

    for (int k = 0 ; k < 75 * 45 * 2 - 1; k+= 2) {
        int red = ((Shark_map[k + 1] & 0xF8) >> 3) << 11;
        int green  = (((Shark_map[k] & 0xE0) >> 5)) | ((Shark_map[k+1] & 0x7) << 3) ;		                
        int blue = (Shark_map[k] & 0x1f);
            
        short int p = red | ( (green << 5) | blue);

        if(i <= VGA_X_MAX && i >= VGA_X_MIN && j >= VGA_Y_MIN  && j <= VGA_Y_MAX)
        {
            if (!(Shark_map[k] == 0x00 && Shark_map[k+1] == 0x00)){
                plot_pixel( 0 + i, j, p);
            }
        }
                
        i+=1;

        if (i == curr->data.x + curr->data.width + offset) {
            i = curr->data.x - offset;
            j+=1;
        }

        if (j >= curr->data.y + curr->data.height + offset){
            return;
        }
    }
}

void clear_obstacle_helper(struct node* curr, int offset){
    int i = curr->data.x + offset;
    int j = curr->data.y - offset;

    for (int k = ((320 * j + i) * 2); k < (320 * 240 * 2 - 1); k+= 2) {
        int red = ((OceanBG_map[k + 1] & 0xF8) >> 3) << 11;
        int green  = (((OceanBG_map[k] & 0xE0) >> 5)) | ((OceanBG_map[k+1] & 0x7) << 3) ;		                
        int blue = (OceanBG_map[k] & 0x1f);			
                
		short int p = red | ( (green << 5) | blue);
                
        if(i <= VGA_X_MAX && i >= VGA_X_MIN && j >= VGA_Y_MIN  && j <= VGA_Y_MAX)
        {
            short int color = return_color(i,j);
            if(color != p){
                plot_pixel( 0 + i, j, p);
            }
        }
                
        i+=1;

        if (i == curr->data.x + curr->data.width + offset) {
            i = curr->data.x - offset;
            j+=1;
            k = ((320*j + i)*2 - 2);
        }

        if (j >= curr->data.y + curr->data.height + offset){
            return;
        }
    }
}

//Print text on the Screen
void printTextOnScreen(int x, int y, char *scorePtr){
    /* assume that the text string fits on one line */
    int offset = (y << 7) + x;

    while (*(scorePtr)){ // while it hasn't reach the null-terminating char in the string
        // write to the character buffer
        *(character_buffer + offset) = *(scorePtr);
        ++scorePtr;
        ++offset;
    }
}

